create table Patients (
	Patient_ID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	DateOfBirth DATE,
	ContactNumber VARCHAR(50),
	Email VARCHAR(50),
	HealthConditions VARCHAR(13),
	WearableDeviceID VARCHAR(50)
);


create table Doctors (
	Doctor_ID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Specialty VARCHAR(16),
	Department_ID INT,
	TelemedicineAvailable VARCHAR(50)
);


create table Appointment (
	Appointment_ID INT,
	Patient_ID INT,
	Doctor_ID INT,
	AppointmentDate DATE,
	Status VARCHAR(11),
	AppointmentType VARCHAR(12)
);


create table Health_Data (
	HealthData_ID INT,
	Patient_ID INT,
	DateRecorded DATE,
	HeartRate INT,
	BloodPressure DECIMAL(10,2),
	BloodSugarLevel DECIMAL(10,2),
	Notes VARCHAR(40)
);


create table Billing (
	Billing_ID INT,
	Appointment_ID INT,
	TotalAmount INT,
	InsuranceCovered VARCHAR(50),
	AmountPaid INT,
	PaymentStatus VARCHAR(14)
);


create table Predictive_Alerts (
	Alert_ID INT,
	Patient_ID INT,
	AlertDate DATE,
	AlertMessage VARCHAR(60)
);
